#include <assert.h>
#include <stdint.h>
#include <stdio.h>
#include <sys/time.h>
#include <string>
#include <vector>
#include <list>
using std::string;
using std::vector;
using std::list;

uint64_t getCurMillseconds() {
    struct timeval now;
    gettimeofday(&now, NULL);
    return now.tv_sec * 1000 + now.tv_usec / 1000;
}

class Solution 
{
public:
    string minWindow(string s, string t) 
    {
        string results = "";
        //printf("%d: %lu\n", __LINE__, getCurMillseconds());
        vector<list<int> > char_indice(128); 
        for (int i = 0; i < s.size(); ++i)
        {
            char c = s[i];
            list<int>& indice = char_indice[c];
            indice.push_back(i);
        }
        //printf("%d: %lu\n", __LINE__, getCurMillseconds());
        vector<list<int> > result_indice(128);
        vector<int> result_indice_flag(s.size(), 0);
        int min_index = s.size() + 1;
        int max_index = -1;
        vector<int> result_stat(128, 0);
        for (int i = 0; i < t.size(); ++i)
        {
            char c = t[i];
            ++result_stat[c];
        }
        for (int i = 0; i < result_stat.size(); ++i)
        {
            char c = i;
            int count = result_stat[i];
            if (count == 0) continue;
            if (count > char_indice[c].size()) return "";
            list<int>::iterator head = char_indice[c].begin();
            list<int>::iterator tail = head;
            int tmp_max = 0;
            while (count-- > 0)
            {
                result_indice_flag[*tail] = 1; 
                tmp_max = *tail;
                ++tail;
            }; 
            result_indice[c].splice(result_indice[c].end(), char_indice[c], head, tail);
            if (*head < min_index) min_index = *head;
            if (tmp_max > max_index) max_index = tmp_max;
        }

        int cur_min_index = min_index;
        int cur_max_index = max_index;
        for (int index = min_index + 1; index < s.size(); ++index)
        {
            char c = s[index];
            if (result_indice[c].size() == 0)
            {
                continue;
            }
            if (index <= result_indice[c].back())
            {
                continue;
            }
            int remove_index = result_indice[c].front();
            int new_index = char_indice[c].front();
            char_indice[c].pop_front();
            result_indice[c].pop_front();
            result_indice[c].push_back(new_index);
            result_indice_flag[remove_index] = 0;
            result_indice_flag[new_index] = 1;
            if (remove_index == cur_min_index)
            {
                cur_min_index = remove_index + 1;
                while (result_indice_flag[cur_min_index] == 0)
                    ++cur_min_index;
            }
            if (new_index > cur_max_index)
                cur_max_index = new_index;
            if (cur_max_index - cur_min_index < max_index - min_index)
            {
                max_index = cur_max_index;
                min_index = cur_min_index;
            }
        }
        //printf("%d: %lu\n", __LINE__, getCurMillseconds());

        results = string(s, min_index, max_index - min_index + 1);
        return results;
    }
};

